// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./../Pool/AvatarPool.sol";
import "./../Pool/StonePool.sol";
import "./../Pool/WearablePool.sol";
import "./Box.sol";


/// @custom:security-contact giorgio@allena.it
contract Shop is Ownable {

    address private AvatarPoolAddress;
    address private StonePoolAddress;
    address private WearablePoolAddress;
    address private BoxAddress;
    address private token21BJAddress;

    // TODO: Get and set
    uint256 private baseNFTResellPrice;
    uint256 private MaxNFTResellPrice;
    uint256 private feePercentageShopMaintance;


    uint256 private ShopPriceListPointer;
    uint256 private liquidityValue;

    struct shopInfoBox {
        uint256 ShopPriceListNumber;
        uint256 tokenId;

        uint256 tokenPrice;

        bool exist;
        address seller;
    }

    mapping(uint256 => shopInfoBox) public shopInfoBoxList;





    constructor(

        address _AvatarPoolAddress,
        address _StonePoolAddress,
        address _WearablePoolAddress,
        address _BoxAddress,
        address _token21BJAddress,
        
        uint256 _baseNFTResellPrice,
        uint256 _MaxNFTResellPrice,
        uint256 _feePercentageShopMaintance

    ) {
        AvatarPoolAddress = _AvatarPoolAddress;
        StonePoolAddress = _StonePoolAddress;
        WearablePoolAddress = _WearablePoolAddress;
        BoxAddress = _BoxAddress;
        token21BJAddress = _token21BJAddress;

        baseNFTResellPrice = _baseNFTResellPrice;
        MaxNFTResellPrice = _MaxNFTResellPrice;
        feePercentageShopMaintance = _feePercentageShopMaintance;

        ShopPriceListPointer = 1;
    }


    // This function permit to user to sell their NFT to shop
    function sell(uint256 _tokenId, uint256 price) public returns(uint256) {
        require(!shopInfoBoxList[_tokenId].exist, "This NFT can not be set in sell more than one time");
        require(price > baseNFTResellPrice, "Base price is too small");
        require(price > MaxNFTResellPrice, "Base price is too big");

        if (AvatarPool(AvatarPoolAddress).ownerOfNFT(_tokenId)) {
            AvatarPool(AvatarPoolAddress).transferNFT(msg.sender, address(this), _tokenId);
        } else if (StonePool(StonePoolAddress).ownerOfNFT(_tokenId)) {
           StonePool(StonePoolAddress).transferNFT(msg.sender, address(this), _tokenId);
        } else if (WearablePool(WearablePoolAddress).ownerOfNFT(_tokenId)) {
            WearablePool(WearablePoolAddress).transferNFT(msg.sender, address(this), _tokenId);
        } else if (Box(BoxAddress).ownerOfNFT(_tokenId)) {
            Box(BoxAddress).transferNFT(msg.sender, address(this), _tokenId);
        } else revert("Token not exist");


        uint256 splp = ShopPriceListPointer++;

        shopInfoBoxList[splp].ShopPriceListNumber = splp;
        shopInfoBoxList[splp].tokenId = _tokenId;
        shopInfoBoxList[splp].tokenPrice = price;
        shopInfoBoxList[splp].exist = true;
        shopInfoBoxList[splp].seller = msg.sender;

        return splp;
    }

    // This function permit to user to buy a NFT from list. Buy for NFTkey
    function buy(uint256 splp) public {
        require(shopInfoBoxList[splp].exist, "This NFT can not be found in shop. Check the tokenId");
        uint256 _tokenId = shopInfoBoxList[splp].tokenId;
        address poolAddressVar = address(0x0);

        if (AvatarPool(AvatarPoolAddress).ownerOfNFT(_tokenId)) poolAddressVar = AvatarPoolAddress;
        else if (StonePool(StonePoolAddress).ownerOfNFT(_tokenId)) poolAddressVar = StonePoolAddress; 
        else if (WearablePool(WearablePoolAddress).ownerOfNFT(_tokenId)) poolAddressVar = WearablePoolAddress;
        else if (Box(BoxAddress).ownerOfNFT(_tokenId)) poolAddressVar = BoxAddress;
        else revert("Token not exist");

        payFunction(_tokenId, poolAddressVar);
        
        shopInfoBoxList[_tokenId].exist = false;
        liquidityValue += feePercentageShopMaintance;
    }

    function payFunction (uint256 _tokenId, address poolAddressVar) internal {
        require(poolAddressVar != address(0x0), "Error in NFT recognition");

        if (!IERC20( token21BJAddress ).transferFrom(msg.sender, shopInfoBoxList[_tokenId].seller, shopInfoBoxList[_tokenId].tokenPrice )) 
            revert("transferFrom sender to this failed");
        if (!IERC20( token21BJAddress ).transferFrom(msg.sender, shopInfoBoxList[_tokenId].seller, ((feePercentageShopMaintance / 100) * shopInfoBoxList[_tokenId].tokenPrice) )) 
            revert("transferFrom sender to this failed");

        AvatarPool(poolAddressVar).transferNFT(address(this), msg.sender, _tokenId);
    }


    // Permit to user to get out from shop an NFT
    function retireNFTFromShop (uint256 splp) public {
        require(shopInfoBoxList[splp].exist, "This NFT can not be found in shop. Check the tokenId");
        require(shopInfoBoxList[splp].seller == msg.sender, "Only owner can retire NFT");
        uint256 _tokenId = shopInfoBoxList[splp].tokenId;

        if (AvatarPool(AvatarPoolAddress).ownerOfNFT(_tokenId)) AvatarPool(AvatarPoolAddress).transferNFT(address(this), msg.sender, _tokenId);
        else if (StonePool(StonePoolAddress).ownerOfNFT(_tokenId)) StonePool(StonePoolAddress).transferNFT(address(this), msg.sender, _tokenId); 
        else if (WearablePool(WearablePoolAddress).ownerOfNFT(_tokenId)) WearablePool(WearablePoolAddress).transferNFT(address(this), msg.sender, _tokenId);
        else if (Box(BoxAddress).ownerOfNFT(_tokenId)) Box(BoxAddress).transferNFT(address(this), msg.sender, _tokenId);
        else revert("Token not exist");

    }



    // TODO: Set and Gets ! 
    function setBaseNFTResellPrice (uint256 _baseNFTResellPrice) public onlyOwner { baseNFTResellPrice = _baseNFTResellPrice; }
    function getBaseNFTResellPrice () public view returns (uint256) { return baseNFTResellPrice; }


    function getNFTResellPriceById (uint256 _tokenId) public view returns(uint256) { return shopInfoBoxList[_tokenId].tokenPrice + ((feePercentageShopMaintance / 100) * shopInfoBoxList[_tokenId].tokenPrice); }


    function getShopInfoListById (uint256 _tokenId) public view returns(shopInfoBox memory) { return shopInfoBoxList[_tokenId]; }

    function withdraw () public onlyOwner {
        if (!IERC20( token21BJAddress ).transferFrom(address(this), msg.sender, liquidityValue)) 
            revert("transferFrom sender to this failed");       
        liquidityValue = 0;
    }

}
